import React from 'react'

class Projects extends React.Component{
    render(){
        return (
            <div name="Projects">
                <h1>This is a Project!</h1>
                <ProjectPane name="Test"> This would be a description </ProjectPane>
            </div>
        )
    }
}

export default Projects
